import React from "react";

function Logo() {
  return (
    <div className="flex justify-around mb-[5rem] items-center ">
      <p className="text-[1.5rem] font-bold text-slate-300 max-sm:text-[1rem] ">
        Deloitte
      </p>
      <p className="text-[1.5rem] text-slate-300 max-sm:text-[1rem]">houzz</p>
      <p className="text-[1.5rem] font-bold text-slate-300 max-sm:text-[1rem]">
        Zillow
      </p>
      <p className="text-[1.5rem] font-bold text-slate-300 max-sm:text-[1rem]">
        BrightHouse
      </p>
    </div>
  );
}

export default Logo;
